import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";

const body_cart = () => {
  const [showApi, setShowApI] = useState([]);

  useEffect(() => {
    axios
      .get("https://fakestoreapi.com/products")
      .then((res) => {
        setShowApI(res.data);
      })
      .catch((err) => console.log(err));
  }, []);
  return (
    <div>
      <div>
          {showApi}
      </div>
    </div>
  );
};

export default body_cart;
